import './App.css';

const menu_list = [
  {
    "id": 1,
    "name": "초코와플",
    "price": 7000,
    "image": ""
  },
  {
    "id": 2,
    "name": "아메리카노",
    "price": 4000,
    "image": ""
  },
  {
    "id": 3,
    "name": "블루베리스무디",
    "price": 6000,
    "image": "https://upload.wikimedia.org/wikipedia/commons/1/15/Blueberries.jpg"
  },
  {
    "id": 4,
    "name": "딸기와플",
    "price": 7000,
    "image": "https://upload.wikimedia.org/wikipedia/commons/2/29/PerfectStrawberry.jpg"
  }
]

function MenuBox() {

  const Menu = menu_list.map((list) => (
    <div className='Menu'>
      <div className='MenuID'><span>{list.id}</span></div>
      <div className='MenuName'><span>{list.name}</span></div>
      <div className='MenuPrice'><span>{list.price}</span></div>
    </div>
  ))


  return (
    <div className="MenuBox">
      <div className='MenuBox_1'>
        <div className='Search'>
          <span>이름 검색: </span><input></input>
        </div>
        <div className='MenuListBox'>
          <div className='Menu'>
            <div className='MenuID'><span>ID</span></div>
            <div className='MenuName'><span>이름</span></div>
            <div className='MenuPrice'><span>가격</span></div>
          </div>
          {Menu}
        </div>
      </div>
      <div className='MenuBox_2'>
        <p>{menu_list[0].id}</p>
        <p>{menu_list[0].price}</p>
      </div>
    </div>

  );
}

export default MenuBox;
